import Navbar from './NavBar';
import Home from './Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Create from './Create';

function App() {


  return (
    <Router>
    <div className="App">
      <Navbar/>
      <div className="component">
      <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path="/create">
          <Create/>
        </Route>
      </Switch>
      </div>


    </div>
    </Router>
  );
}

export default App;
